  return (
    <>
      <Navbar />
      <section id="intro">
        <img
          src={process.env.PUBLIC_URL + "/images/background.jpg"}
          alt="Background"
        />
        <div className="container">
          <h1 className="text-white">Welcome to Hotel Haven</h1>
          <p></p>
        </div>
      </section>
      <section id="about">
        div
      </section>
      <Footer />
    </>
  );
};

export default Home;
